from sympy import isprime, primerange
def afull():
    alst, prime_strs, an, digits = [], ["2", "3", "5", "7"], 0, 1
    while len(prime_strs) > 0:
        new_prime_strs = set()
        for p in prime_strs:
            can_extend = False
            for d in "123456789":
                c = d + p
                if isprime(int(c)):
                    can_extend = True
                    new_prime_strs.add(c)
            if digits > 1 and not can_extend:
                alst.append(int(p))
        prime_strs = new_prime_strs
        digits += 1
    return sorted(alst)
